import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom"; // Import Router components
import Login from "./pages/Login"; // Import Login component
import Existing from "./pages/Existing"; // Import Existing component
import Header from "./Header"; // Import Header component if needed

function App() {
  return (
    <Router>
      {" "}
      {/* Wrap everything in Router */}
      <div>
        <Header /> {/* Optional: You can include Header here if needed */}
        <Routes>
          <Route path="/" element={<Login />} />{" "}
          {/* Render Login component on the root path */}
          <Route path="/pages/Existing" element={<Existing />} />{" "}
          {/* Corrected route */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
